script: |
  super -f text -I q9514.spq | sort > q9514.out

inputs:
  - name: q9514.spq
    data: |
      SELECT - ( - 30 ) + + cor1.col0 * - 2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q9514.out
    data: |
      -130
      -130
      -130
      -98
      -98
      -98
      24
      24
      24
